import ExpenseItem from "./components/ExpenseItem";

const App = () => {
  const expenses = [
    {
      id: 'el1',
      title: 'Toilet paper',
      amount: 94.65,
      date: new Date(2021, 7, 14)
    },
    {
      id: 'el2',
      title: 'Car Insurance',
      amount: 284.98,
      date: new Date(2022, 2, 14)
    },
    {
      id: 'el3',
      title: 'New Tv',
      amount: 494.65,
      date: new Date(2022, 3, 24)
    },
    {
      id: 'el4',
      title: 'food',
      amount: 194.65,
      date: new Date(2022, 4, 16)
    }
  ];
  // expenses.forEach(expense => {
  //   console.log(expense.title)
  return (
    <div>
      <p>This is a react app</p>

        <ExpenseItem 
          title={expense.title} 
          amount={expense.amount} 
          date={expense.date}
        />
        <ExpenseItem 
          title="test"
          amount="{expense.amount}" 
          date="{expense.date}"
        />
    </div>
  );
// });
}

export default App;
